-- ----------------------------
-- Procedure structure for insertIntoDqa
-- ----------------------------
DROP PROCEDURE IF EXISTS `insertIntoDqa`;
delimiter ;;
CREATE PROCEDURE `insertIntoDqa`(in n int)
BEGIN
 
 set @nn = 0;
 
 add_loop:loop  -- 创建循环add_loop
   if @nn < n THEN  
     set @nn = @nn+1;
   else
	   leave add_loop;  -- 不满足条件后就跳出循环
   end if;  -- 必须结束if
 end loop add_loop;  -- 必须结束循环
 
select * from dqa ORDER BY id desc;  -- 打印出插入数据后的表的数据
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for insertIntoTest
-- ----------------------------
DROP PROCEDURE IF EXISTS `insertIntoTest`;
delimiter ;;
CREATE PROCEDURE `insertIntoTest`()
BEGIN
 set @tnum = null; -- 设置变量接受表的数据量
 
 select count(*) into @tnum from test; -- 将表的数据量赋值给变量
 
 add_loop:loop  -- 创建循环add_loop
   if @tnum < 1000 THEN  -- 判断表中是否小于1000条数据
     set @tnum = @tnum+1;
   else
	 leave add_loop;  -- 不满足条件后就跳出循环
   end if;  -- 必须结束if
 end loop add_loop;  -- 必须结束循环
 
select * from test;  -- 打印出插入数据后的表的数据
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for type
-- ----------------------------
DROP PROCEDURE IF EXISTS `type`;
delimiter ;;
CREATE PROCEDURE `type`()
BEGIN
 set @tnum = 'select total as t,count(1) as n from test where 1 = 1 GROUP BY total ';
 set @num1 = null;
 
 SELECT
	  GROUP_CONCAT(DISTINCT  /*将去重后的所有的name逐一放在“sum (case when ...)”中，再将期接起来*/
	    CONCAT(
	      'SUM(CASE WHEN a.t = \'',    /*使用了转义符斜杠*/
				a.total , 
				'\' THEN a.n else 0 END) AS \'',
	      a.total,
				'\''
	    )
	  ) INTO @num1  /*赋值到变量*/
	FROM 
	   test a;    /*至此，一串自动sum(case when ......)的语句拼接完成*/
 
 
 set @sql = concat(
 
     'select ',
		 @num1,
		 ' from (',
		 @tnum,
		 ') a'
 
 );
 #select @sql;
 PREPARE stmt FROM @sql;  /*然后就是执行了*/
 EXECUTE stmt;
 DEALLOCATE PREPARE stmt;
END
;;
delimiter ;

